  return (
    <div className="bg-black w-full h-full text-white">
      <nav className="mx-12 mt-4 flex justify-between items-center h-9">
        <div className="bg-yellow-500 w-5 aspect-square rounded-md"> . </div>
        <h1>EST SB</h1>
        <button className="bg-white text-black"></button>
      </nav>
    </div>
  );
}
